import{_ as e,o as a,c as t,O as i}from"./chunks/framework.9482e208.js";const m=JSON.parse('{"title":"§ 19.2-11.5 Definitions.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/19.2-11.5.md","filePath":"vacode/19.2-11.5.md"}'),o={name:"vacode/19.2-11.5.md"},n=i('<h1 id="§-19-2-11-5-definitions" tabindex="-1">§ 19.2-11.5 Definitions. <a class="header-anchor" href="#§-19-2-11-5-definitions" aria-label="Permalink to &quot;§ 19.2-11.5 Definitions.&quot;">​</a></h1><p>As used in this chapter, unless the context requires a different meaning:</p><p>&quot;Anonymous physical evidence recovery kit&quot; means a physical evidence recovery kit that is collected from a victim of sexual assault through a forensic medical examination where the victim elects, at the time of the examination, not to report the sexual assault offense to a law-enforcement agency.</p><p>&quot;Department&quot; means the Virginia Department of Forensic Science.</p><p>&quot;Division&quot; means the Division of Consolidated Laboratory Services of the Virginia Department of General Services.</p><p>&quot;Health care provider&quot; means any hospital, clinic, or other medical facility that provides forensic medical examinations to victims of sexual assault.</p><p>&quot;Law-enforcement agency&quot; means the state or local law-enforcement agency with the primary responsibility for investigating an alleged sexual assault offense case and includes the employees of that agency.</p><p>&quot;Physical evidence recovery kit&quot; means any evidence collection kit supplied by the Department to health care providers for use in collecting evidence from victims of sexual assault during forensic medical examinations or to the Office of the Chief Medical Examiner for use during death investigations to collect evidence from decedents who may be victims of sexual assault.</p><p>&quot;Sexual assault offense&quot; means a violation or attempted violation of any offense enumerated in Article 7 (§ <a href="http://law.lis.virginia.gov/vacode/18.2-61/" target="_blank" rel="noreferrer">18.2-61</a> et seq.) of Chapter 4 of Title 18.2 or of any offense specified in § <a href="http://law.lis.virginia.gov/vacode/18.2-361/" target="_blank" rel="noreferrer">18.2-361</a>, <a href="http://law.lis.virginia.gov/vacode/18.2-370/" target="_blank" rel="noreferrer">18.2-370</a>, or <a href="http://law.lis.virginia.gov/vacode/18.2-370.1/" target="_blank" rel="noreferrer">18.2-370.1</a>.</p><p>&quot;Victim of sexual assault&quot; means any person who undergoes a forensic medical examination for the collection of a physical evidence recovery kit connected to a sexual assault offense.</p><p>2016, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?161+ful+CHAP0332" target="_blank" rel="noreferrer">332</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?161+ful+CHAP0698" target="_blank" rel="noreferrer">698</a>.</p>',11),r=[n];function s(c,l,f,h,p,d){return a(),t("div",null,r)}const v=e(o,[["render",s]]);export{m as __pageData,v as default};
